INSERT INTO portalbox VALUES (19,'ILO Conventions: background and preparatory work', '<div class="span2"><img hspace="25" vspace="35" align="left" src="https://www.ilo.org/dyn/media/images/power/e14049.jpg"></div><div class="span5 marginIC"><div align="justify">Discover the background and history of the adoption of ILO Conventions. For each instrument, you will find texts of the preparatory reports, discussions at the International Labour Conference, committee reports, votes and texts of the Convention. It covers all up-to-date Conventions and 5 Protocols.</div> <div><span class="convItems">DP</span><span class="defs"> - Discussion in plenary </span><span class="convItems">Pre</span><span class="defs"> - Preparatory document </span><span class="convItems">Com</span><span class="defs"> - Report of the Committee </span><span class="convItems">LP</span><span class="defs"> - List of participants </span> <br><span class="convItems">Rec</span><span class="defs"> - Recommendation </span><span class="convItems">Res</span><span class="defs"> - Resolution </span><span class="convItems">T</span><span class="defs"> - Text of the Convention, Text of the Protocol </span><span class="convItems">V</span><span class="defs"> - Vote </span> <hr> <div>See also: <a href="http://www.ilo.org/dyn/normlex/en/f?p=1000:1">NORMLEX</a> - Information System on International Labour Standards</div></div>');
INSERT INTO portalbox VALUES (20,'Convenios de la OIT: antecedentes y trabajos preparatorios', '<div class="span2"><img hspace="25" vspace="35" align="left" src="https://www.ilo.org/dyn/media/images/power/e14049.jpg"></div><div class="span5 marginIC"><div align="justify">Descubra los antecedentes y el proceso histórico de los Convenios de la OIT. Para cada uno de estos instrumentos se proporcionan los textos de sus informes preparatorios, las discusiones en la Conferencia Internacional del Trabajo, los informes de comisión, los votos y los textos de cada Convenio. La Colección cubre todos los Convenios en vigor y los 5 Protocolos.</div> <div><span class="convItems">DP</span><span class="defs"> - Discusión en sesión plenaria </span><span class="convItems">Pre</span><span class="defs"> - Documento preparatorio </span><span class="convItems">Com</span><span class="defs"> - Informe de la Comisión </span><span class="convItems">LP</span><span class="defs"> - Lista de participantes </span> <br><span class="convItems">Rec</span><span class="defs"> - Recomendación </span><span class="convItems">Res</span><span class="defs"> - Resolución </span><span class="convItems">T</span><span class="defs"> - Texto del Convenio, Texto del Protocolo </span><span class="convItems">V</span><span class="defs"> - Votación </span> <hr><div>Véase también: <a href="http://www.ilo.org/dyn/normlex/es/f?p=1000:12000">NORMLEX</a> - Base de datos sobre las Normas Internacionales del Trabajo.</div></div>');
INSERT INTO portalbox VALUES (21,'Conventions de l\'OIT: historique et documents préparatoires', '<div class="span2"><img hspace="25" vspace="35" align="left" src="https://www.ilo.org/dyn/media/images/power/e14049.jpg"></div><div class="span5 marginIC"><div align="justify">La bibliothèque numérique des conventions de l\’OIT vous permet de découvrir l\’historique des conventions de l\’OIT. Vous trouverez, pour chaque instrument,  les textes des rapports préparatoires, les débats à la Conférence internationale du Travail, les rapports de commission, les résultats des votes et les textes des conventions. La bibliothèque numérique contient toutes les conventions à jour et les 5 protocoles.</div><div><span class="convItems">DP</span><span class="defs"> - Discussion en séance plénière </span><span class="convItems">Pre</span><span class="defs"> - Document préparatoire </span><span class="convItems">Com</span><span class="defs"> - Rapport de la commission </span><br /><span class="convItems">LP</span><span class="defs"> - Liste de participants </span>  <span class="convItems">Rec</span><span class="defs"> - Recommandation </span><span class="convItems">Res</span><span class="defs"> - Résolution </span><span class="convItems">T</span><span class="defs"> - Texte de la convention, Texte du Protocole </span><span class="convItems">V</span><span class="defs"> - Vote </span><hr><div>Voir aussi: <a href="http://www.ilo.org/dyn/normlex/fr/f?p=1000:1">NORMLEX</a> - Système d\’information sur les normes internationales du travail</div></div>');
INSERT INTO portalbox VALUES (22, 'International Labour Conference', '<div class="span2"><img src="http://www.ilo.org//dyn/media/images/thumbs/e16664.jpg" align="left" hspace="30" style="width: 80%";></div><div class ="span6 paddingIC">The links below allow you to browse the <a onclick="newWin(this.href); return false;" href="http://www.ilo.org/ilc/"><font color="grey">International Labour Conference</font></a> reports by year. To find reports by topic, use the search box above.</div></div><hr><div class="row"><ul class="list-1"><li>Reports of the Director-General</li><br/><ul class="list-2"><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Report of the Director General to the International Labour Conference. 1921-" href="/record/336779?ln=en">Report of the Director General to the International Labour Conference, 1921-</a></li><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Global Report under the follow-up to the ILO Declaration on Fundamental Principles and Rights at Work" href="/record/336780?ln=en">Global Report under the follow-up to the ILO Declaration on Fundamental Principles and Rights at Work</a></li><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Report on the Situation of Workers in the Occupied Arab Territories - Appendix" href="/record/336778?ln=en">Report on the Situation of Workers in the Occupied Arab Territories - Appendix</a></li></ul><hr><li><a alt="Programme, budget and other financial questions - Report II" href="/record/188754?ln=en">Programme, budget and other financial questions - Report II</a></li><hr><li><a alt="Application of Conventions and Recommendations - Report III" href="/record/188789?ln=en">Application of Conventions and Recommendations - Report III</a></li><br/><ul class="list-2"><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Application of Conventions and Recommendations - Report III" href="/record/188789?ln=en">Report on the Committee of Experts on the Application of Conventions and Recommendations - Report III (1A)</a></li><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Application of Conventions and Recommendations - Report III" href="/record/188789?ln=en">General Survey - Report III (1B)</a></li><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Application of Conventions and Recommendations - Report III" href="/record/188789?ln=en">Information document on ratifications and standards-related activities &ndash; Report III (2)</a></li></ul><hr><li><a alt="Technical reports presented to the Conference - Reports IV-XII" href="/search?ln=en&cc=invsbl+ILCtechreports&jrec=1">Technical reports presented to the Conference - Reports IV-XII</a></li><hr><li><a alt="Record of Proceedings" href="/search?recid=188744&ln=en">Record of Proceedings</a></li><hr><li><a alt="Resolutions adopted by the International Labour Conference" href="/search?ln=en&recid=188782">Resolutions adopted by the International Labour Conference</a></li></div>');
INSERT INTO portalbox VALUES (23, 'Conferencia Internacional del Trabajo', '<div class="span2"><img src="http://www.ilo.org//dyn/media/images/thumbs/e16664.jpg" align="left" hspace="30" style="width: 80%";></div><div class ="span6 paddingIC">A continuación se presentan los enlaces que permiten acceder a los informes de la <a onclick="newWin(this.href); return false;" href="http://www.ilo.org/global/meetings-and-events/international-labour-conference/lang--es/index.htm"><font color="grey">Conferencia Internacional del Trabajo</font></a> por año.Para buscar informes por tema, debe utilizarse la caja de búsqueda de arriba.</div></div><hr><div class="row"><ul class="list-1"><li>Memorias del Director General</li><br/><ul class="list-2"><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Memoria del Director General a la Conferencia Internacional del Trabajo. 1928-" href="/record/339255?ln=es">Memoria del Director General a la Conferencia Internacional del Trabajo, 1928-</a></li><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Informe Global con arreglo al seguimiento de la Declaración de la OIT relativa a los principios y derechos fundamentales en el trabajo" href="/record/339261?ln=es">Informe Global con arreglo al seguimiento de la Declaración de la OIT relativa a los principios y derechos fundamentales en el trabajo</a></li><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Informe sobre la situación de los trabajadores en los territorios árabes ocupados- Anexo" href="/record/339258?ln=es">Informe sobre la situación de los trabajadores en los territorios árabes ocupados- Anexo</a></li></ul><hr><li><a alt="Proposiciones de programa y presupuesto y otras cuestiones financieras - Informe II" href="/record/188754?ln=en">Proposiciones de programa y presupuesto y otras cuestiones financieras - Informe II</a></li><hr><li><a alt="Aplicación de Convenios y Recomendaciones - Informe III" href="/record/188791?ln=es">Aplicación de Convenios y Recomendaciones - Informe III</a></li><br/><ul class="list-2"><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Informe de la Comisio´n de Expertos en Aplicacio´n de Convenios y Recomendaciones – Informe III (1A)" href="/record/188791?ln=es">Informe de la Comisio´n de Expertos en Aplicacio´n de Convenios y Recomendaciones – Informe III (1A)</a></li><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Estudio general – Informe III (1B)" href="/record/188791?ln=es">Estudio general – Informe III (1B)</a></li><li><i class="icon-caret-right"></i> &nbsp;&nbsp;&nbsp; <a alt="Documento informativo sobre ratificaciones y actividades normativas – Informe III (2)" href="/record/188791?ln=es">Documento informativo sobre ratificaciones y actividades normativas – Informe III (2)</a></li></ul><hr><li><a alt="Informes técnicos presentados a la Conferencia – Informes IV-XII" href="/search?ln=es&cc=invsbl+ILCtechreports&jrec=1">Informes técnicos presentados a la Conferencia – Informes IV-XII</a></li><hr><li><a alt="Actas de las sesiones" href="/record/188750?ln=es">Actas de las sesiones</a></li><hr><li><a alt="Resoluciones adoptadas por la Conferencia Internacional del Trabajo" href="/record/188780?ln=es">Resoluciones adoptadas por la Conferencia Internacional del Trabajo</a></li></div>');
